import './App.css';
import React from 'react';
import ApplicationBar from "./menu/ApplicationBar";
import myPhoto from "../images/myPhotoBlackWhite.png"

function App() {
    return (
        <div>
            <ApplicationBar/>
            <div style={{background: '#263238', borderRadius: '0rem 0rem 5rem 5rem', float: 'right'}}>
                <img style={{opacity: '0.8'}} src={myPhoto}/>
            </div>
        </div>
    );
}

export default App;


